Evenement.227593X30X1783:
Par arrêté de la ministre de l'enseignement supérieur, de la recherche et de l'innovation en date du 11 octobre 2019, sont nommés membres du comité éthique et scientifique de la plateforme Parcoursup :
Mme Isabelle FALQUE-PIERROTIN, présidente, en remplacement de Mme Noëlle LENOIR ;
M. Jean-Marie FILLOQUE, en remplacement de M. Julien GRENET ;
Mme Isabelle ROUSSEL, en remplacement de Mme Laure LUCCHESI ;
M. Jean-Richard CYTERMANN.

Par arrêté de la ministre de l'enseignement supérieur, de la recherche et de l'innovation en date du 9 mars 2018, sont nommés membres du comité éthique et scientifique de la plateforme Parcoursup :
Mme Noëlle LENOIR, présidente ;
M. Gérard BERRY, vice-président ;
M. Max DAUCHET ;
M. Julien GRENET ;
Mme Laure LUCCHESI ;
Mme Catherine MOISAN.

